import { Fragment } from "react";
import "./App.css";
import Header from "./components/header/Header";
import WelcomeText from "./components/welcome/WelcomeText";
import CreatePost from "./components/create-post/CreatePost";

function App() {
  return (
    <Fragment>
      <Header />
      <WelcomeText />
      <CreatePost />
    </Fragment>
  );
}

export default App;
